import AppLayout from "../components/AppLayout";
import Head from "next/head";
const Home = () => {
  const isLoggedIn = useSelector((state) => state.user.isLoggedIn);
  const mainPosts = useSelector((state) => state.post.mainPosts);
  return (
    <>
      <Head>
        <meta charSet="utf-8" />
        <title>NodeBird</title>
      </Head>
      <AppLayout>
        <PostForm />
        <PostCard />
      </AppLayout>
    </>
  );
};

export default Home;
